(6581, '1', 60, 'PARTAI DEMOKRASI INDONESIA PERJUANGAN', '327320310564****', 'Dr', 'ANDREAS HUGO PAREIRA', '-', 'MAUMERE', '31/05/1964', 'Laki-Laki', 'Katolik', 'Sudah Menikah', 'Chatarina V. Dwi Indarwati P', '1', 'Komp. Bougenville Blok C / 6', 'S3', 'Anggota DPR 2014-2019', 'Tidak Ada', '-', '-', '-', 7346, 'https://infopemilu.kpu.go.id/pileg2019/pencalonan/calon/7346', 'KOTA BANDUNG', '2011-03-18 21:35:00', '2011-03-18 21:35:00'),
(6582, '1', 60, 'Partai NasDem', '317406100956****', '', 'JOHNNY G PLATE', 'SE', 'Ruteng', '10/09/1956', 'Laki-Laki', 'Katolik', 'Sudah Menikah', 'Maria Ana Soewarni, SH', '3', 'Jalan Bango I No 6', 'D4/S1', 'Anggota DPR 2014-2019', 'Tidak Ada', '', '', '-', 10029, 'https://infopemilu.kpu.go.id/pileg2019/pencalonan/calon/10029', 'JAKARTA SELATAN', '2011-03-18 21:35:00', '2019-03-21 15:49:22'),
(6583, '1', 60, 'PARTAI AMANAT NASIONAL', '347114260875****', '-', 'AHMAD YOHAN', 'M.Si', 'ENDE', '26/08/1975', 'Laki-Laki', 'Islam', 'Sudah Menikah', 'Nikmah Azizah', '3', 'Purbayan KG 3/1274', 'S2', 'Anggota DPR 2014-2019', 'Tidak Ada', 'Eksistensi manusia sebenarnya ditentukan oleh kemanfaatannya terhadap orang lain. sebagaimana hadits Rasulullah SAW, ?Bahwa sebaik-baik manusia adalah yang paling bermanfaat bagi orang lain? (HR Ahmad At Thabrani, Ad Daruqutni). Untuk itu, dalam momentum pileg 2019 nanti saya berikhtiar maju sebagai calon anggota DPR-RI dan kelak jika terpilih kembali, dengan jabatan tersebut saya dapat bekerja sesuai tugas dan wewenang sebagai anggota DPR RI untuk memperjuangkan kesejahteraan masyarakat banyak,  khususnya di dapil NTT 1.', 'Jika terpilih kembali menjadi anggota DPR-RI, secara pribadi anggota DPR-RI berkewajiban diantaranya untuk, 1). menyerap, menghimpun dan menampung serta menindak lanjuti aspirasi-aspirasi masyarakat, 2). memperhatikan serta memperjuangkan kesejahteraan masyarakat, 3) menjaga etika dan norma hubungan kerja dengan lembaga yang terkait, 4). menaati kode etik dan tata tertib DPR.', '-', 20194, 'https://infopemilu.kpu.go.id/pileg2019/pencalonan/calon/20194', 'KOTA YOGYAKARTA', '2011-03-18 21:35:00', '2011-03-18 21:35:00'),
(6584, '1', 60, 'Partai Kebangkitan Bangsa', '317502230565****', '-', 'N. M. DIPO NUSANTARA P. U', 'SH', 'KOTA SURABAYA', '23/05/1965', 'Laki-Laki', 'Islam', 'Sudah Menikah', 'AFIFAH AFIYANI', '3', 'JL.PULOMAS BARAT VI NO.53', 'D4/S1', 'Swasta', 'Tidak Ada', 'Membela Rakyat', 'Memenangkan pemilu DPR RI 2019', '-', 21159, 'https://infopemilu.kpu.go.id/pileg2019/pencalonan/calon/21159', 'JAKARTA TIMUR', '2011-03-18 21:35:00', '2011-03-18 21:35:00'),
(6585, '1', 60, 'Persatuan Indonesia', '320101270176****', '-', 'SELESTINUS A. OLA', 'SH', 'Maumere', '27/01/1976', 'Laki-Laki', 'Katolik', 'Sudah Menikah', 'Herni Dwi Yanti', '2', 'Puri Nirwana 3 Blok DB NO.07', 'D4/S1', 'ADVOKAT', 'Tidak Ada', 'TERPANGGIL UNTUK MEMBANGUN TURUT SERTA MEMBANGUN BANGSA DAN NEGARA GUNA MENSEJAHTERAKAN MASYARAKAT TANPA KKN', 'MEMENANGKAN PARTAI PERINDO DI DAPIL, GUNA MEREBUT KEKUASAAN LEGISLATIF AGAR DAPAT BERPARTISIPASI MEWUJUDKAN KESEJAHTERAAN RAKYAT TANPA KKN', '-', 50075, 'https://infopemilu.kpu.go.id/pileg2019/pencalonan/calon/50075', 'BOGOR', '2011-03-18 21:35:00', '2011-03-18 21:35:00'),
(6586, '1', 60, 'Partai Keadilan Sejahtera', '327606090669****', '-', 'MUJTAHID RAHMAN YADI', '-', 'Jakarta', '09/07/1969', 'Laki-Laki', 'Islam', 'Sudah Menikah', 'Evi Suci Lestari', '5', 'Jl. Margonda Raya gg. Ciliwung', 'SMA/Sederajat', 'Swasta', 'Tidak Ada', 'Ikut serta membangun daerah NTT lebih maju dan sejahtera Memperjuangkan aspirasi masyarakat NTT dari berbagai bidang Mengembangkan potensi ekonomi budaya masyarakat lebih baik', 'Menyerap dan memperjuangkan aspirasi masyarakat NTT. Mengembangkan potensi peternakan dan wisata di wilayah NTT.', '-', 65345, 'https://infopemilu.kpu.go.id/pileg2019/pencalonan/calon/65345', 'KOTA DEPOK', '2011-03-18 21:35:00', '2011-03-18 21:35:00'),
(6587, '1', 60, 'PARTAI GERAKAN INDONESIA RAYA', '327105101068****', '-', 'PIUS LUSTRILANANG', 'S.IP., M.Si', 'PALEMBANG', '10/10/1968', 'Laki-Laki', 'Katolik', 'Pernah Menikah', 'IBU', '3', 'JL. DRUPA III NO. 1', 'S2', 'Anggota DPR 2014-2019', 'Tidak Ada', '2019 PRABOWO PRESIDEN', 'MEMPERJUANGKAN ANGGARAN UNTUK NTT', '-', 94022, 'https://infopemilu.kpu.go.id/pileg2019/pencalonan/calon/94022', 'KOTA BOGOR', '2011-03-18 21:35:00', '2011-03-18 21:35:00'),
(6588, '1', 60, 'Partai Golongan Karya', '367403081263****', '-', 'MELCHIAS MARKUS MEKENG', '-', 'JAKARTA', '08/12/1963', 'Laki-Laki', 'Katolik', 'Sudah Menikah', 'MARIA LAURENTIA WIDYANA SOEHADI', '3', 'RIVER PARK BLOK GF.5/5, BINTARO JAYA SEKTOR 8', 'S2', 'Anggota DPR 2014-2019', 'Tidak Ada', 'MEMPERJUANGKAN ASPIRASI MASYARAKAT MELALUI LEGISLASI PENGANGGARAN DAN PENGAWASAN, KHUSUSNYA MASYARAKAT NTT DI DAPIL 1, YANG MELIPUTI FLORES, LEMBATA, ALOR', 'MEMPERJUANGKAN PEMBANGUNAN INFRASTRKTUR, DAN MENINGKATKAN TARAF HIDUP MASYARAKAT NTT', '-', 153009, 'https://infopemilu.kpu.go.id/pileg2019/pencalonan/calon/153009', 'KOTA TANGERANG SELATAN', '2011-03-18 21:35:00', '2011-03-18 21:35:00'),
(6589, '1', 60, 'PARTAI DEMOKRAT', '317406190962****', 'Dr', 'BENNY KABUR HARMAN', 'SH', 'Flores', '19/09/1962', 'Laki-Laki', 'Katolik', 'Sudah Menikah', 'Dr.drg. MARIA G. ERNAWATI, SPBM', '3', 'Jl. Haji Sijan No. 99', '-', 'Pengacara', 'Tidak Ada', 'Melanjutkan perjuangan untuk mewujudkan cita-cita dan ideologi Partai Demokrat yakni terbentuknya masyarakat Indonesia yang adil, makmur, sejahtera dan demokratris dalam wadah Negara Kesatuan Republik Indonesia berdasarkan Pancasila dan UUD NKRI 1945.', 'Targetnya ialah PD di Dapil NTT 1 memperoleh dukungan suara terbanyak sehingga di DPR baik pusat maupun Provinsi, Kabupaten dan Kota, Partai Demokrat memperoleh kursi yang signifikan untuk memperjuangkan cita-cita dan ideologi Partai Demokrat dalam pemerintahan.', '-', 154369, 'https://infopemilu.kpu.go.id/pileg2019/pencalonan/calon/154369', 'JAKARTA SELATAN', '2011-03-18 21:35:00', '2019-03-21 15:49:24'),
(6590, '1', 60, 'Partai Solidaritas Indonesia', '317508220459****', '-', 'ROBERT SOTER MARUT', '-', 'MANGGARAI', '22/04/1959', 'Laki-Laki', 'Katolik', 'Sudah Menikah', 'EUPHEMIA SOEMENI', '2', 'JL RAJAWALI RAYA NO 20 LANUD HALIM P', 'SMA/Sederajat', 'PENSIUNAN TNI AU', 'Tidak Ada', 'INGIN MELAYANI MASYARAKAT NTT', '1. MEMBANTU MENGUMPULKAN ASPIRASI MASYARAKAT /WARGA NTT 2. MEMBANTU PERCEPATAN PEMBANGUNAN NTT 3. MELAYANI DALAM BIDANG PENDIDIKAN DAN KESEHATAN 4. MEMBANTU MEMANTAU DANA APBD SUPAYA TEPAT SASARAN  5. MEMBANTU MEMBESARKAN PARTAI NASDEM', '-', 175478, 'https://infopemilu.kpu.go.id/pileg2019/pencalonan/calon/175478', 'JAKARTA TIMUR', '2011-03-18 21:35:00', '2011-03-18 21:35:00'),
