(6599, '2', 60, 'Partai Keadilan Sejahtera', '327601310884****', '-', 'AGUS ISMAIL', 'S.Si, M.Eng', 'Jakarta', '31/08/1984', 'Laki-Laki', 'Islam', 'Sudah Menikah', 'Nur Aini', '4', 'Perumahan Bukit Dago Cluster Arkadia Blok A11 No. 28', 'S2', 'Swasta', 'Tidak Ada', 'Ingin memberikan kontribusi dan pelayanan kepada masyarakat Indonesia Timur, khususnya NTT agar pendidikan, kesehatan dan kesejahteraan masyarakat meningkat dan lebih baik lagi. Selain itu, juga ingin mengoptimalkan sumber daya alam dan meningkatkan kualitas sumber daya manusia masyarakat', 'Akan bekerja dan membina konstituen di dapil khususnya dan masyarakat NTT pada umumnya sesuai dengan penempatan di Komisi DPR. Agar sesuai dengan motivasi, saya ingin ditempatkan di Komisi VII', '-', 52688, 'https://infopemilu.kpu.go.id/pileg2019/pencalonan/calon/52688', 'BOGOR', '2011-03-18 21:35:00', '2011-03-18 21:35:00'),
