(6605, '2', 60, 'Partai Golongan Karya', '327610130472****', '-', 'HONING SANNY', '-', 'ENDE', '13/04/1972', 'Laki-Laki', 'Katolik', 'Sudah Menikah', 'BERNADETHA MARIA SERE N ABA', '2', 'APARTEMEN TAMAN RASUNA TOWER 14 UNIT 6E JL. RASUNA SAID KUNINGAN JAKARTA SELATAN', 'D4/S1', 'Swasta', 'Tidak Ada', 'INGIN MEMPERJUANGKAN ASPIRASI RAKYAT NTT DI DPR SEKALIGUS MEMBANTU MEMPERJUANGKAN PEMBANGUNAN MANUSIA NTT YANG MASIH TERTINGGAL DALAM BANYAK HAL DIBANDINGKAN DENGAN PROPINSI-PROPINSI LAIN DI INDONESIA', 'TARGET UTAMA SAYA ADALAH INGIN MEMAMBAH JUMLAH KURSI GOLKAR DI DAPIL NTT 1 YANG SEBELUMNYA SATU KURSI MENJADI DUA KURSI. SAYA BERJANJI AKAN MENAMBAH KURSI BERDASARKAN PENGALAMAN SEBELUMNYA MENJADI DPR RI DARI PARTAI YANG LAIN', '-', 190011, 'https://infopemilu.kpu.go.id/pileg2019/pencalonan/calon/190011', 'JAKARTA SELATAN', '2011-03-18 21:35:00', '2011-03-18 21:35:00'),
