(6630, '4', 60, 'PARTAI AMANAT NASIONAL', '531012150950****', 'Drs', 'ANTONY BAGUL DAGUR', 'M.Si', 'Racang-Welak', '15/09/1950', 'Laki-Laki', 'Katolik', 'Sudah Menikah', 'Florentin Tince Kumpul', '5', 'Jl. Ki Hajar Dewantara', 'S2', 'Swasta', 'Tidak Ada', 'a. Sebagai dosen Tata Negara 39 Tahun dan sebagai dosen Komunikasi Politik serta Birokrat sejati yang berpuncak pada Bupati Manggarai periode 2000 s.d 2005, saya merasa diri amat layak untuk turut menyumbangkan tenaga dan pikiran melalui di DPR RI melalui Partai Amanat Nasional. b. Sebagai senior Pamong Praja, saya merasa lebih layak.', 'a. Amandemenkan UUD 1945 ( yang ke ? 5) untuk menata ulang lembaga negera seperti DPD (dihapuskan dan diganti dengan Utusan Daerah), berarti tiap daerah harus ada Wakilnya di Pusat sesuai hakekat NKRI b. Mengatur ulang Sistem Presidensil secara tegas sehingga tidak terkesan Parlementer. c. Memperjuangkan aspirasi rakyat antara lain Pembentukan Provinsi Flores dan Pemekaran Kabupaten yang layak. d. Memperjuangkan kebutuhan rakyat sesuai karateristik geografis sesuai prinsip dasar otonomi daerah. e. Menunjukkan kepada seluruh rakyat Indonesia sebagai DPR RI yang bersih dari Korupsi, Kolusi, dan Nepotisme demi kokohnya NKRI.', '-', 103951, 'https://infopemilu.kpu.go.id/pileg2019/pencalonan/calon/103951', 'MANGGARAI', '2011-03-18 21:35:00', '2011-03-18 21:35:00'),
