(6641, '5', 60, 'Partai Keadilan Sejahtera', '737113120874****', 'Dr', 'DAHLAN LAMABAWA', 'S.Ag, M.Ag', 'leubatang', '12/08/1974', 'Laki-Laki', 'Islam', 'Sudah Menikah', 'Amirah Mawardi, S.Ag, M.Si', '0', 'Bukit Salekowa Permai blok D.17', 'S3', 'Swasta', 'Tidak Ada', '\"Saya termotivasi menjadi anggota DPR RI, merupakan manivestasi dari panggilan moral saya untuk hadir sebagai bagian dari solusi  terhadap permasalahan masyarakat NTT. 1.	Masyarakat NTT pada umumnya hidup di bawa garis kemiskinan, disebabkan dari faktor  minimnya industri dan infrastruktur yang tersedia, padahal NTT memiliki potensi SDA di daratan dan di lautan yang berlimpah. 2.	Minimnya fasilitas layanan pendidikan, kesehatan, pembinaan keagamaan, dan layanan administrasi pada TKI asal NTT 3.	Umat Islam NTT lemah secara politik, selain faktor minoritas, juga faktor lemahnya pendidikan politik\"', '\"Insya Allah apabila saya terpilih menjadi anggota DPR RI, maka saya akan menggunakan hak budget melalui APBN untuk: 1.	Membangun industri dan infrastruktur yang dapat memacu lompatan ekonomi masyarakat NTT dan peningkatan Pendapatan Asli Daerah (PAD) 2.	Menyediakan fasilitas layanan pendidikan, kesehatan, pembinaan keagamaan, serta layanan administrasi Tenaga Kerja Indonesia (TKI) yang memadai. 3.	Melakukan penguatan pendidikan politik umat Islam NTT agar dapat memainkan peran politiknya secara signifikan\"', '-', 53366, 'https://infopemilu.kpu.go.id/pileg2019/pencalonan/calon/53366', 'KOTA MAKASSAR', '2011-03-18 21:35:00', '2011-03-18 21:35:00'),
(6642, '5', 60, 'Partai Solidaritas Indonesia', '317505090463****', '-', 'ROBERTHUS BAIT KEYTIMU', 'S.H', 'FLORES', '09/04/1963', 'Laki-Laki', 'Katolik', 'Sudah Menikah', 'ELFRIDA YOLLY MAINA DEWI WINOKAN', '2', 'JL PENDIDIKAN III NO 62', 'D4/S1', 'PENGACARA', 'Tidak Ada', 'MEMPERJUANGKAN PENEGAKKAN SUPREMASI HUKUM, DALAM PEMBERANTASAN KORUPSI DI INDONESIA SALAH SATU CARA ADALAH MELAKUKAN SUMPAH ADAT TERHADAP PEJABAT BAIK EKSEKUTIF MAUPUN LEGISLATIF CARANYA ADALAH SEBELUM DILAKUKAN SUMPAH KENEGARAAN MAKA PEJABAT YANG BERSANGKUTAN HARUS TERLEBIH DAHULU MELAKUKAN SUMPAH ADAT DI DAERAH MASING-MASING YG DIPANDU OLEH KEPALA ADAT SETEMPAT, DAN DISAKSIKAN OLEH MASYARAKAT ADAT DIWILAYAH TERSEBUT DAN DIBUATKAN BERITA ACARA.', '1. SOAL PENEGAKAN SUPREMASI HUKUM DI INDONESIA 2.REFORMASI TERHADAP BIROKRASI 3. MEMPERJUANGKAN KEMBALI UUD 1945, AMANDEMEN HANYA MENYANGKUT PEMILIHAN PRESIDEN SECARA LANGSUNG', '-', 91340, 'https://infopemilu.kpu.go.id/pileg2019/pencalonan/calon/91340', 'JAKARTA TIMUR', '2011-03-18 21:35:00', '2011-03-18 21:35:00'),
(6643, '5', 60, 'Partai NasDem', '327602070660****', '', 'EDUARDUS HENA', 'SE.,M.Si', 'ORINGBELE', '07/06/1960', 'Laki-Laki', 'Katolik', 'Sudah Menikah', 'Anika Dwika Biere', '3', 'Permata Puri II Blok CC- IV No.10', 'S2', 'Dosen', 'Tidak Ada', 'Ingin Membuat Suatu Perubahan untuk Meningkatkan Kesejahteraan Masyarakat di Nusa Tenggara Timur .', '1. Pendidikan Masyarakan Meningkat\r\n2. Kehidupan Ekonomi Meningkat\r\n3. Kesehatan Meningkat\r\n4. Kebebasan Masyarakat untuk Berpendapat', '-', 98725, 'https://infopemilu.kpu.go.id/pileg2019/pencalonan/calon/98725', 'KOTA DEPOK', '2011-03-18 21:35:00', '2019-03-21 15:50:03'),
