(6656, '6', 60, 'Partai Hati Nurani Rakyat', '321606190166****', 'Drs', 'MOHAMMAD SALEH GAWI', '', 'BARANUSA ALOR', '19/01/1966', 'Laki-Laki', 'Islam', 'Sudah Menikah', 'AISYAH IKA', '2', 'jln Bogor Raya km. 20, Perumahan Dharma Puri No. 88-D', 'D4/S1', 'Swasta', 'Tidak Ada', 'Menggunakan akar konstituen partai guna mengantarkan HANURA sebagai partai  Papan Tengah  pada Pemilu 2019 demi mengantarkan NKRI menuju sebagaimana tertuang dalam pembukaan UUD 1945', 'Memajukan Provinsi NTT dengan mendorong perhatian Pemerintah pusat di bidang infastruktur, dan pengembangan Sumber Daya Perikanan yang diintergrasikan dengan Pariwisata. Mengontrol secara ketat penggunaan anggaran pembangunan di segala sektor demi menekan kebocoran keuangan', '-', 56981, 'https://infopemilu.kpu.go.id/pileg2019/pencalonan/calon/56981', 'JAKARTA TIMUR', '2011-03-18 21:35:00', '2019-03-21 15:50:16'),
