(6668, '1', 61, 'Partai Keadilan Sejahtera', '317410110185****', '-', 'AHMAD FATHUL BARI', 'S.Hum., M.S.M.', 'Jakarta', '11/01/1985', 'Laki-Laki', 'Islam', 'Sudah Menikah', 'Wieke Harmandar', '1', 'Jalan Depsos Raya No. 39', 'S2', 'Swasta', 'Tidak Ada', '\"?	Mewakili aspirasi masyarakat Indonesia, khususnya masyarakat Provinsi Nusa Tenggara Timur ?	Mengoptimalkan fungsi anggota legislatif, khususnya yang mewakili Provinsi NTT, melalui peningkatan kinerja legislasi, anggaran, dan pengawasan dalam upaya pembangunan daerah dan masyarakat NTT ?	Mendukung penguatan 4 pilar kebangsaan serta sosialisasi urgensinya kepada masyarakat\"', '\"?	Mengoptimalkan fungsi legislasi, anggaran, dan pengawasan terhadap penyediaan dan peningkatan sarana air bersih dan listrik untuk masyarakat, serta secara khusus mendorong dan mengawal Dana Alokasi Khusus Fisik untuk Provinsi NTT dalam hal tersebut  ?	Mengoptimalkan fungsi legislasi, anggaran, dan pengawasan dalam bidang pendidikan dan kesehatan, serta secara khusus mendorong dan mengawal Dana Alokasi Khusus Non-Fisik untuk Provinsi NTT terkait Tunjangan Profesi Guru, Tunjangan Profesi Tenaga Kesehatan, dsb ?	Mengoptimalkan fungsi legislasi, anggaran, dan pengawasan dalam upaya mengembangkan potensi dan pemberdayaan pemuda di Provinsi NTT, terutama dalam mengembangkan ekonomi kreatif berbasis Revolusi Industri 4.0 ?     Mengoptimalkan fungsi legislasi, anggaran, dan pengawasan dalam menanggulangi dan mencegah terjadinya kasus human trafficking, khususnya bagi masyarakat Provinsi NTT Memperkuat dan mengonsolidasikan berbagai lembaga dan komunitas masyarakat di Provinsi NTT, melalui kunjungan, serap aspirasi, dan partisipasi dalam Musyawarah Perencanaan Pembangunan (Musrenbang) Provinsi NTT\"', '-', 53098, 'https://infopemilu.kpu.go.id/pileg2019/pencalonan/calon/53098', 'JAKARTA SELATAN', '2011-03-18 21:35:00', '2011-03-18 21:35:00'),
(6669, '1', 61, 'PARTAI GERAKAN INDONESIA RAYA', '537104070268****', 'Ir', 'FARY DJEMY FRANSCIS', 'MMA', 'WATAMPONE', '07/02/1968', 'Laki-Laki', 'Kristen Protestan', 'Sudah Menikah', 'YOCA O. YOHANNES, SE', '3', 'JL. BUMI III', 'S2', 'Anggota DPR 2014-2019', 'Tidak Ada', '2019 GERINDRA MENANG, PRABOWO PRESIDEN, NTT SEJAHTERA, INDONESIA JAYA', 'BEKERJA, MELAYANI DAN BERJUANG BERSAM RAKYAT MENJADIKAN INDONESIA BANGSA YANG KUAT, TERHORMAT, ADIL DAN MAKMUR. YANG DISEGANI SEBAGAI MANA TANTANGAN BANGSA YANG DIGAMBARKAN OLEH PANDANGAN STRATEGIS  KETUA UMUM PARTAI GERINDRA BAPAK PRABOWO SUBIANTO DALAM BUKU PARADOKS INDONESIA', '-', 93564, 'https://infopemilu.kpu.go.id/pileg2019/pencalonan/calon/93564', 'KOTA KUPANG', '2011-03-18 21:35:00', '2011-03-18 21:35:00'),
