(6700, '3', 61, 'Partai Persatuan pembangunan', '352517230191****', '-', 'SAIFUL ULUM', 'SAP', 'GRESIK', '23/01/1991', 'Laki-Laki', 'Islam', 'Sudah Menikah', 'Nur Azizah Febryanti', '0', 'J.A Suprapto VIII No 91', 'D4/S1', 'Tenaga Ahli Anggota DPR RI Periode 2014-  2019', 'Tidak Ada', 'Untuk menyerap dan menjembatani serta memperjuangkan aspirasi rakyat di daerah pemilihan agar dapat masuk dalam setiap proses pengambilan kebijakan dan pembuatan undang-undang. Selain itu agar bisa memastikan dan mengawasi jalannya pemerintahan yang  berkeadilan dan sesuai aspirasi masyarakat serta amanat Undang-undang.', 'Kelompok pemuda dan perempuan yg bergerak di bidang ekonomi kreatif, pendidikan serta kelompok rentan yang selama ini kurang mendapatkan perhatian. Memberdayakan perekonomian warga desa untuk menopang perekonomian desa, daerah bahkan nasional.', '-', 151930, 'https://infopemilu.kpu.go.id/pileg2019/pencalonan/calon/151930', 'GRESIK', '2011-03-18 21:35:00', '2011-03-18 21:35:00'),
(6701, '3', 61, 'PARTAI DEMOKRAT', '537103040175****', '', 'WINSTON NEIL RONDO', '', 'UJUNG PANDANG', '01/04/1975', 'Laki-Laki', 'Kristen Protestan', 'Sudah Menikah', 'PDT. DESIANA RONDO', '1', 'JALAN ALFONS NISNONI', '-', 'Swasta', 'Tidak Ada', '1. Memperjangkan agar program - program pro rakyat ala SBY dapat dilakukan lebih banyak dan lebih dirasakan oleh rakyat NTT.2. Mendorong keberpihakan politik anggaran yang lebih besar untuk sektor pendidikan, kesehatan dan tenaga kerja karena ini yang sangat dibutuhkan rakyat NTT saat ini', '1. Memperjuangkan agar kebijakan populis pro rakyat dalam bidang pendidikan seperti peningkatan jumlah anggaran pendidikan untuk NTT, perjuangan alokasi Beasiswa miskin, peningkatan honor/kesra guru, peningkatan dana untuk pembangunan sarana prasarana sekolah yang rusak, pelatihan - pelatihan untuk guru dapat lebih diperbanyak.2. Dalam bidang kesehatan, selain meningkatkan alokasi APBN untuk memperkuat sektor kesehatan di NTT, juga untuk memperkuat program pro rakyat seperti JKN untuk 100 persen warga miskin NTT (sekarang 68%), peningkatan sarana - sarana agar setiap Puskesmasmemiliki dokter dan dokter ahli, setiap Puskesmas memiliki fasilitas rawat inap, beasiswa untuk dokter dan dokter spesialis, jadikan RSU W.Z. YOHANIS sebagai rumah sakit vertikal yang dibiayai pusat supaya lebih baik mutunya, ambulans terapung untuk daerah kepulauan NTT dll.3. Dalam bidang tenaga kerja dengan menyediakan kerjasama lebih luas untuk membangun pusdiklat atau BLK di kabupaten/kota untuk latih tenaga kerja muda sesuai kebutuhan pasar, sedikan modal kerja untuk pebisnis pemula,diklat wirausaha untuk para pemuda, kesempatan magang di industri dan perusahaan - perusahaan besar dll.', '-', 154724, 'https://infopemilu.kpu.go.id/pileg2019/pencalonan/calon/154724', 'KOTA KUPANG', '2011-03-18 21:35:00', '2019-03-21 15:51:09'),
