(6717, '4', 61, 'PARTAI DEMOKRAT', '317401610476****', '', 'ELFIRA SYLVIANI KAUNANG', '', 'Bogor', '21/04/1976', 'Perempuan', 'Katolik', 'Sudah Menikah', 'Antonius Eka Wijaya', '3', 'Tebet Barat VII', '-', 'Swasta', 'Tidak Ada', 'Lebih aktif dalam memberdayakan masyarakat NTT khususnya Dapil NTT 2 melalui Partai Demokrat.', 'Keberpihakan dalam kebijakan anggaran bagi masyarakat NTT khususnya masyarakat perbatasan dan perempuan NTT sebagai pilar utama dan pertama pengelolah dan pemanfaat kekayaan sumber daya alam, tanah adat, perkebunan dan hasilnya dengan memperkuat pendidikan dan pembangunan karakter bagi penerus bangsa.', '-', 154139, 'https://infopemilu.kpu.go.id/pileg2019/pencalonan/calon/154139', 'JAKARTA SELATAN', '2011-03-18 21:35:00', '2019-03-21 15:51:37'),
