(6719, '4', 61, 'PARTAI AMANAT NASIONAL', '530207250569****', '-', 'ALFRED BAUN', 'SH', 'LELOBATAN', '25/05/1970', 'Laki-Laki', 'Kristen Protestan', 'Sudah Menikah', 'Aksa Aprilia Medriana Suek', '5', 'JL. ALAMAT', 'D4/S1', 'Swasta', 'Tidak Ada', 'Hak hak rakyat dari sisi pembangunan, ekonomi, kesehatan yang belum terpecahkan selama ini. Selain itu produk perundang-undangan yang tidak berpihak kepada kaum marginal termasuk penyelewengan keuangan Negara atau Korupsi di Negara Republik Indonesia.', 'Memperjuangkan hak-hak rakyat dari sisi pembangunan, ekonomi, kesehatan yang belum merata dan tidak tepat sasaran, kinerja pemerintahan untuk kesejahteraan rakyat maupun penyelewengan keuangan negara atau Korupsi yang terus menerus meningkat diNegara Kesatuan Republik Indonesia agar terciptanya Kesejahteraan rakyat dan keadilan sosial bagi seluruh rakyat Indonesia', '-', 192723, 'https://infopemilu.kpu.go.id/pileg2019/pencalonan/calon/192723', 'TIMOR TENGAH SELATAN', '2011-03-18 21:35:00', '2011-03-18 21:35:00'),
