(6751, '7', 61, 'Partai Solidaritas Indonesia', '537104200469****', '-', 'PITER THINUNG PITOBY', 'SE', 'ENDE', '20/04/1969', 'Laki-Laki', 'Kristen Protestan', 'Belum Menikah', '-', '-', 'JL. ALFONSUS NISNONI NO.32', 'D4/S1', 'Swasta', 'Tidak Ada', 'Ingin mengabdikan diri kepada bangsa dan negara', 'Menciptakan perundang2an yg tdk multi tafsir dan tumpang tindih agar terciptanya penyelenggaran pemerintahan yg bersih dari korupsi dan memerangi semua radikalisme yg bersifat intoleran', '-', 62090, 'https://infopemilu.kpu.go.id/pileg2019/pencalonan/calon/62090', 'KOTA KUPANG', '2011-03-18 21:35:00', '2011-03-18 21:35:00'),
(6752, '7', 61, 'Persatuan Indonesia', '537104040769****', '-', 'EURICO GUTERRES', 'SE.,MM', 'UATOLARI', '04/07/1969', 'Laki-Laki', 'Katolik', 'Pernah Menikah', 'GUIDA B.B. DE ARAUJO', '3', 'JL. GEREJA MORIA NO.17', 'S2', 'WIRASWASTA', 'Tidak Ada', '1. MEMPERJUANGKAN TEGAKNYA PANCASILA DAN UUD 1945. 2. MEMPERJUANGKAN VISI DAN MISI PERINDO. 3. MEMPERJUANGKAN ASPIRASI NILAI-NILAI PANCASILA', '1. MEMPERTAHANKAN NILAI-NILAI PANCASILA DAN UUD 1945 2. MEMPERTAHANKAN TOLERANSI YANG HARMONIS DIANTARA SELURUH KOMPONEN MASYARAKAT INDONESIA 3. MELAKSANAKAN FUSNGSI LEGISLATIF, ANGGARAN, DAN FUNGSI PENGAWASAN', '-', 88498, 'https://infopemilu.kpu.go.id/pileg2019/pencalonan/calon/88498', 'KOTA KUPANG', '2011-03-18 21:35:00', '2011-03-18 21:35:00'),
(6753, '7', 61, 'PARTAI AMANAT NASIONAL', '517103590381****', '-', 'MARIA JOSEFA BETE', 'Amd.keu', 'Atambua', '19/03/1981', 'Perempuan', 'Islam', 'Sudah Menikah', 'Debi Indra Kusuma', '2', 'Jl. Pulau Komodo No 28', 'D3', 'Swasta', 'Tidak Ada', '?Memperjuangkan Aspirasi Rakyat khususnya daerah NTT terutama dibidang ekonomi, lingkungan hidup dan pariwisata?.', 'a). membangun pilar Bangsa :yaitu dibidang Ekonomi,lingkungan hidup dan pariwisata.dan tentu saja untuk untuk membangun smua itu saya akan bermitra dan bekerjasama dengan smua pihak pada bidang masing-masing dan membuat kebijakan yang sekiranya dapat membangun dan menguntungkan semua pihak untuk membuat kondisi menjadi lebih baik. Dan Tentu saja hal tersebut akan terwujud menjadi beragram program untuk kesejahteraan Rakyat dan pastinya Dengan dukungan dari Rakyat khususnya daerah NTT melalui komunikasi yang aktif dan Partisipatif.', '-', 121633, 'https://infopemilu.kpu.go.id/pileg2019/pencalonan/calon/121633', 'KOTA DENPASAR', '2011-03-18 21:35:00', '2011-03-18 21:35:00'),
(6754, '7', 61, 'PARTAI BERKARYA', '317407150172****', '', 'MUHAMAD LUDFY', '', 'SURABAYA', '15/01/1972', 'Laki-Laki', 'Islam', 'Pernah Menikah', '0', '2', 'JL. CIPAYUNG I/20', 'D4/S1', 'Swasta', 'Tidak Ada', 'SAYA MENCALONKAN DIRI SEBAGAI BACALEG DAPIL 2 NTT DIKARENAKAN SAYA INGIN BERKONTRIBUSI PENUH UNTUK MEMAJUKAN WILAYAH NTT, AGAR WILAYAH NTT DAPAT LEBIH DI PANDANG DAN LEBIH DIMINATI BAGI PARA WISATAWAN, TERLEBIH DENGAN KEINDAHAN TEMPAT-TEMPAT WISATA DAN PANORAMA ALAM YANG DIMILIKI.', '1. MENSEJAHTERAKAN RAKYAT NTT.\r\n2. MENGENTASKAN KEMISKINAN YANG ADA DIWILAYAH NTT .\r\n3. MENYELESAIKAN PERMASALAHAN BUSUNG LAPAR DAN GIZI BURUK DI WILAYAH NTT.', '-', 123253, 'https://infopemilu.kpu.go.id/pileg2019/pencalonan/calon/123253', 'JAKARTA SELATAN', '2011-03-18 21:35:00', '2019-03-21 15:53:07'),
